"use strict";const access={init:()=>{},Loggearse(){var t={};t.Correo=$("#txtCorreo").val();t.Password=$("#txtPassword").val();let n={};n.path=window.location.hostname;n.Usuario=t;n=JSON.stringify(n);$.ajax({type:"POST",url:"../../Access/Loggearse",data:n,contentType:"application/json; charset=utf-8",dataType:"json","async":!0,success:function(n){console.log(n.IdUsuario);n.IdUsuario==0?utils.toast(mensajesAlertas.errorLogin,"fail"):(utils.toast(mensajesAlertas.exitoLogin,"ok"),window.location.href="/Home/Productos")},error:function(n,t){console.log(t+": "+n.responseText);console.log("AutenticaciÃ³n fallida")}})},accionesBotones:()=>{$("#btnLogin").on("click",n=>{n.preventDefault(),access.Loggearse()})}};window.addEventListener("load",()=>{access.init(),access.accionesBotones()});